import React from 'react';

function InfoTable(props){
	const stores = props.stores;
	console.log(stores);
	return (
		<div>
			<table className="table table-striped">
				<thead>
					<th>City</th>
					<th>Temperature</th>
					<th>Pressure</th>
					<th>Humidity</th>
					<th>Description</th>
					<th>Wind Speed</th>
				</thead>
				<tbody>
					{stores.map((item, index) => {
						return (
							<tr>
								<td>item.name</td>
								<td>item.temp</td>
								<td>item.pressure</td>
								<td>item.humidity</td>
								<td>item.description</td>
								<td>item.windSpeed</td>
							</tr>
						);
					})}
				</tbody>
			</table>
		</div>
	);
}

export default InfoTable;
